		})(document, 'script', 'facebook-jssdk', 'fb-root'); Šiandien Donny Montell ir Sel lyderis E. Dragūnas atverčia visas kortas ir pristato kūrinį „Nieko verta“. „Kai šią dainą parašiau, buvo kilusi mintis išleisti su Švedijos muzikos kompanija, su kuria dirbu. Dėl užsitęsusių dalykų viduje kilo mintis išleisti Lietuvoje, su lietuvišku tekstu. Kadangi ji turi aiškią emociją ir charakterį, kilo mintis gal duetas? Vėliau kilo mintis, galbūt tai Egis? Kai nusiuntėme jam pasiklausyti demo versiją, jam labai patiko. Tai viskas taip ir gavosi“, - apie dainos atsiradimą pasakoja D. Montvydas. E. Dragūnas, paklaustas apie galimą kūrinio sėkmę, nenorėjo prognozuoti, ar naujoji daina taps kūriniu numeris vienas. „Tai buvo įdomus pabandymas. Tegul žmonės nusprendžia, ne man tai reikėtų spręsti“, - sakė SEL lyderis. Paklausti apie dainos reikšmę bei kam ji skirta, garsūs dainininkai iš pradžių nusijuokė, tačiau vėliau Donatas paaiškino jos prasmę. „Iš pirmo žvilgsnio atrodo apie santykius, apie išdavystę, apie materialumą, kuris dabar pasidarė labai svarbus santykiuose, ieškant savo žmogaus. Yra paslėpta ir kita mintis – nusikaltimas. Mano ir Egio nusikaltimas. Koks nusikaltimas? Čia galima daug interpretuoti, tačiau mes dainuojam apie moteris, kurioms ateina atpildo metas. Aišku, taip pat gali būti ir su vyrais“, - su užuolankomis paaiškino garsus dainininkas. Prie naujojo kūrinio „Nieko verta“ dirbo didelė profesionalų komanda, kartu su garsiais dainininkais prie dainos žodžių kūrybos prisidėjo ir dainų autorius Justas Mamontovas, o baigiamieji darbai buvo atlikti net už Atlanto. Beje, didelį ažiotažą pramogų pasaulyje sukėlė ir D. Montvydo bei E. Dragūno ketinimas dalyvauti nacionalinėje „Eurovizijos“ atrankoje, tačiau Egidijus šioje istorijoje padėjo tašką. „Buvo graudu žiūrėti į aplinkinius, kurie vos ne iš karto norėjo atsiimti savo paraiškas dalyvauti. Tegul dalyvauja savo „Eurovizijoje“, tegul kovoja. Anksti dar mums „Eurovizija“, nes Kaune nėra viešbučio pastatyta“, - nusijuokė Egidijus.
